import React from 'react';

const fireIcon = (
  <img
    src="/fire.png"
    alt="fire"
    style={{ width: '20px', height: '20px', verticalAlign: 'middle', margin: '0 4px', background: '#FFEDEA', borderRadius: '0px' }}
  />
);

const Topbar = () => {
  return (
    <div style={{
      width: '100%',
      height: '48px',
      background: '#FFEDEA',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      boxSizing: 'border-box',
      padding: '0 2vw', // Responsive horizontal padding
      maxWidth: '100vw', // Prevent overflow
      overflow: 'hidden',
    }}>
      <span
        style={{
          color: '#1C264C',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '48px',
          letterSpacing: '-0.05em',
          textTransform: 'capitalize',
          whiteSpace: 'nowrap',
        }}
      >
        {fireIcon} Goods to go near or far booktranspo is here! {fireIcon}
      </span>
    </div>
  );
};

export default Topbar;
